import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './HomeWorker.css'; // Ensure this path is correct

function HomeWorker() {
  const navigate = useNavigate();
  const [showTable, setShowTable] = useState(false);
  const [tableData, setTableData] = useState({ header: '', content: '' });
  const [tableContent, setTableContent] = useState([]);
  const [unitTestData, setUnitTestData] = useState({
    type: '',
    language: '',
    status: 'Pending'
  });
  const [unitTests, setUnitTests] = useState([]);

  const handleEdit = () => {
    navigate('/edit-profile');
  };

  const handleLogout = () => {
    localStorage.clear();
    window.location = '/';
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setTableData({ ...tableData, [name]: value });
  };

  /*const handleAddRow = () => {
    if (tableData.header && tableData.content) {
      setTableContent([...tableContent, tableData]);
      setTableData({ header: '', content: '' });
    }
  };
*/

  const handleAddUnitTest = () => {
    if (unitTestData.type && unitTestData.language) {
      setUnitTests([...unitTests, unitTestData]);
      setUnitTestData({ type: '', language: '', status: 'Pending' });
    }
  };

  const markAsDone = (index) => {
    const updatedUnitTests = [...unitTests];
    updatedUnitTests[index].status = 'Done';
    setUnitTests(updatedUnitTests);
  };
  const handleToggleTable = () => {
    setShowTable(!showTable);
  };


  return (
    <div className="home-container">
      <div className="home-header">
        <div className="header-left">
          <div className="dropdown">
            <button className="dropbtn">Setting</button>
            <div className="dropdown-content">
              <button onClick={handleEdit}>Edit</button>
              <button onClick={handleLogout}>Log Out</button>
            </div>
          </div>
        </div>
        <div className="header-right">
          <span>Worker</span>
        </div>
      </div>
      <div className="home-content">
        <h2>Select a Language</h2>
        <div className="buttons-container">
          <button className="home-button">Python</button>
          <button className="home-button">Java</button>
        </div>
        <button className="home-button" onClick={handleToggleTable}>
          {showTable ? 'Hide Table' : 'Add New Unit Test'}
        </button>
        {showTable && (
          <div className="unit-test-form">
           <input
              type="text"
              name="type"
              placeholder="Unit Test Type"
              value={unitTestData.type}
              onChange={handleInputChange}
            />
            <input
              type="text"
              name="content"
              placeholder="Content"
              value={tableData.content}
              onChange={handleInputChange}
            />
            <button className="home-button" onClick={handleAddRow}>
              Add Row
            </button>
            <table className="content-table">
              <thead>
                <tr>
                  <th>Header</th>
                  <th>Content</th>
                </tr>
              </thead>
              <tbody>
                {tableContent.map((row, index) => (
                  <tr key={index}>
                    <td>{row.header}</td>
                    <td>{row.content}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
}

export default HomeWorker;
